"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[5100],{4740:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"welcome","metadata":{"permalink":"/guide/blog/welcome","editUrl":"https://github.com/Agile4Enterprise/guide/edit/main/blog/blog/2021-08-26-welcome/index.md","source":"@site/blog/2021-08-26-welcome/index.md","title":"Welcome","description":"Docusaurus blogging features are powered by the blog plugin.","date":"2021-08-26T00:00:00.000Z","tags":[{"inline":false,"label":"Framework","permalink":"/guide/blog/tags/framework","description":"Framework"}],"readingTime":0.465,"hasTruncateMarker":true,"authors":[{"name":"Laurent Morisseau","title":"Coach Agile Entreprise @Morisseau Consulting","url":"https://www.morisseauconsulting.com/","page":{"permalink":"/guide/blog/authors/laurent"},"socials":{"linkedin":"https://www.linkedin.com/in/laurentmorisseau/","github":"https://github.com/lmorisse"},"imageURL":"https://github.com/lmorisse.png","key":"laurent"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["laurent"],"tags":["framework"]},"unlisted":false,"nextItem":{"title":"Agile4Enterprise : Le guide devient open source !","permalink":"/guide/blog/guide-open-source"}},"content":"[Docusaurus blogging features](https://docusaurus.io/docs/blog) are powered by the [blog plugin](https://docusaurus.io/docs/api/plugins/@docusaurus/plugin-content-blog).\\n\\nHere are a few tips you might find useful.\\n\\n\x3c!-- truncate --\x3e\\n\\nSimply add Markdown files (or folders) to the `blog` directory.\\n\\nRegular blog authors can be added to `authors.yml`.\\n\\nThe blog post date can be extracted from filenames, such as:\\n\\n- `2019-05-30-welcome.md`\\n- `2019-05-30-welcome/index.md`\\n\\nA blog post folder can be convenient to co-locate blog post images:\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\nThe blog supports tags as well!\\n\\n**And if you don\'t want a blog**: just delete this directory, and use `blog: false` in your Docusaurus config."},{"id":"guide-open-source","metadata":{"permalink":"/guide/blog/guide-open-source","editUrl":"https://github.com/Agile4Enterprise/guide/edit/main/blog/blog/2019-05-28-first-blog-post.md","source":"@site/blog/2019-05-28-first-blog-post.md","title":"Agile4Enterprise : Le guide devient open source !","description":"Nous avons une grande nouvelle \xe0 partager avec vous : le guide du framework Agile4Enterprise est d\xe9sormais open source ! \ud83d\ude80","date":"2019-05-28T00:00:00.000Z","tags":[{"inline":false,"label":"Framework","permalink":"/guide/blog/tags/framework","description":"Framework"}],"readingTime":1.89,"hasTruncateMarker":false,"authors":[{"name":"Laurent Morisseau","title":"Coach Agile Entreprise @Morisseau Consulting","url":"https://www.morisseauconsulting.com/","page":{"permalink":"/guide/blog/authors/laurent"},"socials":{"linkedin":"https://www.linkedin.com/in/laurentmorisseau/","github":"https://github.com/lmorisse"},"imageURL":"https://github.com/lmorisse.png","key":"laurent"}],"frontMatter":{"slug":"guide-open-source","title":"Agile4Enterprise : Le guide devient open source !","authors":["laurent"],"tags":["framework"]},"unlisted":false,"prevItem":{"title":"Welcome","permalink":"/guide/blog/welcome"}},"content":"Nous avons une grande nouvelle \xe0 partager avec vous : **le guide du framework Agile4Enterprise est d\xe9sormais open source !** \ud83d\ude80\\n\\n## Pourquoi cette d\xe9cision ?\\n\\nDepuis le d\xe9but de l\u2019aventure Agile4Enterprise, notre objectif a toujours \xe9t\xe9 clair : **rendre l\u2019agilit\xe9 accessible, \xe9volutive et adapt\xe9e aux sp\xe9cificit\xe9s des PME. Nous croyons en une approche collaborative o\xf9 chacun peut contribuer, apprendre et enrichir le framework avec ses propres exp\xe9riences.\\n\\nMettre notre guide en open source s\u2019inscrit pleinement dans cette vision :\\n\\n\u2705 **Favoriser la transparence et l\u2019accessibilit\xe9** : Toute entreprise, consultant ou passionn\xe9 d\u2019agilit\xe9 peut d\xe9sormais acc\xe9der librement aux contenus et les adapter \xe0 ses besoins.\\n\\n\u2705 **Encourager la contribution de la communaut\xe9** : Que vous soyez praticien aguerri ou d\xe9butant, vos retours et suggestions sont les bienvenus pour enrichir le framework.\\n\\n\u2705 **Acc\xe9l\xe9rer l\u2019innovation agile pour les PME** : L\u2019agilit\xe9 ne doit pas \xeatre r\xe9serv\xe9e aux grandes entreprises. Ensemble, nous pouvons cr\xe9er des solutions pragmatiques et efficaces adapt\xe9es aux r\xe9alit\xe9s des PME.\\n\\n## O\xf9 trouver le guide ?\\n\\nLe guide est disponible d\xe8s maintenant sur **GitHub**. Vous pouvez y acc\xe9der, proposer des am\xe9liorations et m\xeame contribuer directement via des Pull Requests. \ud83d\udd17 [Lien vers le d\xe9p\xf4t GitHub](https://github.com/Agile4Enterprise/guide)\\n\\n## Comment contribuer ?\\n\\nNous avons mis en place un processus simple pour faciliter la participation :\\n\\n1. **Lisez le guide** : D\xe9couvrez les principes et bonnes pratiques du framework.\\n2. **Sugg\xe9rez des am\xe9liorations** : Partagez vos retours via des Issues GitHub.\\n3. **Proposez des mises \xe0 jour** : Soumettez vos am\xe9liorations sous forme de Pull Requests.\\n4. **Participez aux discussions** : Rejoignez notre communaut\xe9 pour \xe9changer sur les \xe9volutions du framework.\\n\\n\ud83d\udc49 Pour en savoir plus sur les contributions, consultez notre [guide du contributeur](https://github.com/Agile4Enterprise/guide/CONTRIBUTING.md).\\n\\n## La suite ?\\n\\nL\u2019ouverture du guide en open source n\u2019est qu\u2019un d\xe9but ! Nous travaillons activement sur :\\n\\n- **Des modules de formation en ligne** \ud83d\udcda\\n- **Des \xe9tudes de cas issues de PME ayant adopt\xe9 le framework** \ud83c\udfe2\\n- **Une certification pour les praticiens Agile4Enterprise** \ud83c\udf93\\n\\nNous avons h\xe2te de construire cette nouvelle \xe9tape avec vous ! Rejoignez-nous d\xe8s aujourd\u2019hui et contribuez \xe0 rendre l\u2019agilit\xe9 encore plus accessible aux PME.\\n\\n\ud83d\udce9 **Des questions, des id\xe9es ?** Contactez-nous sur [notre Slack communautaire](https://agile4enterprise.slack.com) ou laissez un commentaire ci-dessous !\\n\\n\xc0 tr\xe8s bient\xf4t sur GitHub ! \ud83d\ude80"}]}}')}}]);